import React from 'react';
import {RouteComponentProps} from 'react-router';
import AssociationShortInfo from "../../models/associationShortInfo.model";

type WalkConfirmedProps = {
    success?: string | undefined
}
type AssociationCardProps = {
    association: AssociationShortInfo
}

const adresa="Varaždin";

function WalkConfirmedScreen({location}: RouteComponentProps<WalkConfirmedProps>, asso: AssociationCardProps) {

    const props = location.state as WalkConfirmedProps;



    return (
        <div>
            <br/>
            <div className="container-page">
                {
                    /* !!props && !!props.success ?*/

                    <div className="confirmed">
                        <div className="horizontal-center">
                            Šetnja je potvrđena, sada ju možete vidjeti u svom rasporedu.
                        </div>
                        <div className="horizontal-center">
                            Molimo koristite kartu ispod kako biste lakše došli do svoje udruge!

                        </div>
                        <br/><br/> <br/>
                        <iframe
                            width="700"
                            height="550"
                            frameBorder="0"
                            style={{border:0}}
                            src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyCIIskDofJHbJtt5-dBh7_p2s1HExY93BA
                                &q=${adresa}
                                &zoom=20
                                `}
                            allowFullScreen>
                            {/*&maptype=satellite*/}
                        </iframe>

                    </div>

                    /*    :
                        <div className="horizontal-center">Dogodila se greška, pokušajte ponovno prijaviti šetnju!</div>*/
                }
            </div>

        </div>
    );
}

export default WalkConfirmedScreen;
